"1934":{"id":"1934","name":"Shakespeare Apaixonado","slug":"shakespeare-apaixonado","original_title":"Shakespeare in Love","overview":"O jovem Will Shakespeare está para se tornar o dramaturgo de sua época mas é atacado pelo mal dos escritores: um total travamento. Sua comédia Romeu e Ethel, a filha do Pirata não sai do lugar e a estréia se aproxima rapidamente. O que Will precisa é uma musa — e ela aparece na forma da bela Lady Viola. O caminho do verdadeiro amor não vai ser fácil para Will. Viola está prometida em casamento ao insuportável Lorde Wessex sob o comando da Rainha Elizabeth. As alegrias e a tragédia de sua própria vida acabam no papel, tornando-se uma emocionante, inteligente e cativante história.","first_air_date":"1998-12-11","runtime":124,"episode_run_time":[124],"vote_average":6.9,"created_by":["Miramax","Universal Pictures","Bedford Falls Productions"],"production_companies":[{"name":"Miramax"},{"name":"Universal Pictures"},{"name":"Bedford Falls Productions"}],"cast":["Joseph Fiennes","Gwyneth Paltrow","Geoffrey Rush","Tom Wilkinson","Judi Dench"],"backdrop_path":"https://image.tmdb.org/t/p/original/i16MjvM9YsQ85ejdB63gtGXDu4W.jpg","poster_path":"https://image.tmdb.org/t/p/original/3wC7QCcjvT9vRMlWyXoJCbqIuXb.jpg","certification":"14","genres":["Romance","História","Comédia"],"trailer":"N/A"},
