"10172":{"id":"10172","name":"Uma Casa de Pernas Pro Ar","slug":"uma-casa-de-pernas-pro-ar","original_title":"Are We Done Yet?","overview":"Logo após Nick Persons, sua nova esposa Suzanne e os dois filhos dela se mudarem para seu apartamento de solteiro, ele logo percebe que não existe espaço suficiente para a nova família. E com um bebê a caminho, os Persons resolvem deixar a vida na cidade em busca de tranquilidade no campo. Infelizmente, a casa dos seus sonhos começa a desmoronar. Nick tenta resolver os problemas sozinho e acaba se atrapalhando. Mas quando ele contrata o empreiteiro maluco Chuck, cujos métodos nada convencionais destroem ainda mais a casa, os Persons começam a imaginar se algum dia irão chamar esta casa de lar doce lar.","first_air_date":"2007-04-04","runtime":92,"episode_run_time":[92],"vote_average":5.8,"created_by":["Revolution Dream Productions","Revolution Studios","Cube Vision","RKO Pictures LLC"],"production_companies":[{"name":"Revolution Dream Productions"},{"name":"Revolution Studios"},{"name":"Cube Vision"},{"name":"RKO Pictures LLC"}],"cast":["Ice Cube","Nia Long","John C. McGinley","Aleisha Allen","Philip Bolden"],"backdrop_path":"https://image.tmdb.org/t/p/original/xVfjgAzvdmHdW25ZUG3nMKKmauX.jpg","poster_path":"https://image.tmdb.org/t/p/original/54J4z94rP8Ot6SipkSELoGpknWT.jpg","certification":"10","genres":["Família","Comédia"],"trailer":"N/A"},
