"1085218":{"id":"1085218","name":"Darkland: O Retorno","slug":"darkland-o-retorno","original_title":"Underverden 2","overview":"Há sete anos, Zaid entrou em guerra contra o submundo de Copenhague para vingar a morte de seu irmão. Sua identidade como um respeitado médico de cardiologia e a vida como um homem de família é apenas um sonho que se desvanece, e na prisão Zaid sofre a perda de seu filho Noah, que ele mal conhece. Quando um agente policial aborda Zaid e lhe oferece um acordo para ser libertado em troca de se infiltrar no submundo de Copenhague, ele vê sua chance de recuperar os restos da vida familiar que deixou para trás. Mas tudo tem um preço e Zaid percebe que colocou seriamente em perigo a vida do filho. Afinal, uma vez que você se torna parte do submundo, existe alguma saída?","first_air_date":"2023-04-13","runtime":110,"episode_run_time":[110],"vote_average":6.4,"created_by":["Profile Pictures"],"production_companies":[{"name":"Profile Pictures"}],"cast":["Dar Salim","Birgitte Hjort Sørensen","Stine Fischer Christensen","Henrik Vestergård","Soheil Bavi"],"backdrop_path":"https://image.tmdb.org/t/p/original/pUaRgy7grfehKq5dWLSfk1yy02p.jpg","poster_path":"https://image.tmdb.org/t/p/original/q9dJSPEBJXblcxbrWAoSwQv69MB.jpg","certification":"N/A","genres":["Thriller","Ação"],"trailer":"N/A"},
"14746":{"id":"14746","name":"Ruas de Fogo","slug":"ruas-de-fogo","original_title":"Streets of Fire","overview":"Durante um show, a cantora de rock Ellen Aim (Diane Lane) é sequestrada pela gangue de motoqueiros “Os Bombardeiros”, liderados por Raven Shaddock (Willem Dafoe). Quando ex-namorado de Ellen, o bad boy Tom Cody (Michael Paré), retorna à cidade e descobre o que aconteceu, ele parte em seu resgate. Para enfrentar essa violenta guerra de gangues rivais, ele vai contar com a ajuda de Billy Fish (Rick Moranis), o atual empresário de Ellen e McCoy (Amy Madigan), uma ex-soldada.","first_air_date":"1984-06-01","runtime":93,"episode_run_time":[93],"vote_average":6.9,"created_by":["Universal Pictures","RKO Pictures LLC","Silver Pictures"],"production_companies":[{"name":"Universal Pictures"},{"name":"RKO Pictures LLC"},{"name":"Silver Pictures"}],"cast":["Michael Paré","Diane Lane","Rick Moranis","Amy Madigan","Willem Dafoe"],"backdrop_path":"https://image.tmdb.org/t/p/original/bmsxzbIn8BnxPSRP3JDWwtc79KQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/kyZGS5fsfZgfk6aQMYcX4HodZ1z.jpg","certification":"N/A","genres":["Ação"],"trailer":"N/A"},
