"9327":{"id":"9327","name":"O Professor Aloprado","slug":"o-professor-aloprado","original_title":"The Nutty Professor","overview":"Sherman Klump (Eddie Murphy) é um professor universitário com grandes conhecimentos de genética, mas que é sempre ridicularizado por ser extremamente gordo. Porém, quando recebe uma atenção especial de uma bela e jovem professora de matemática (Jada Pinkett), ele decide ingerir um experimento ainda em fase de testes, que altera a cadeia de DNA e faz com que se transforme em um jovem esguio, Buddy Love (Eddie Murphy). A partir de então, Sherman passa a levar uma vida dupla, pois o experimento tem um efeito que dura pouco tempo, levando-o a viver complicadas situações.","first_air_date":"1996-06-28","runtime":95,"episode_run_time":[95],"vote_average":5.6,"created_by":["Universal Pictures","Imagine Entertainment","Eddie Murphy Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Imagine Entertainment"},{"name":"Eddie Murphy Productions"}],"cast":["Eddie Murphy","Jada Pinkett Smith","James Coburn","Larry Miller","Dave Chappelle"],"backdrop_path":"https://image.tmdb.org/t/p/original/gHFuLHxruielBcMEZx1WowxbRWS.jpg","poster_path":"https://image.tmdb.org/t/p/original/xNIOICZCMItkhO5lgthktduNbDA.jpg","certification":"N/A","genres":["Fantasia","Comédia","Romance","Ficção científica"],"trailer":"N/A"},
"2176":{"id":"2176","name":"A Casa de Vidro","slug":"a-casa-de-vidro","original_title":"The Glass House","overview":"Após a morte dos pais em um acidente de carro, dois irmãos vão morar com seus novos pais adotivos. Porém, com o passar do tempo, os irmãos acham que seus 'pais' já procuravam adotá-los antes mesmo da morte dos pais verdadeiros, de olho nos quatro milhões de dólares que eles possuem em forma de ações.","first_air_date":"2001-09-14","runtime":106,"episode_run_time":[106],"vote_average":5.9,"created_by":["Original Film","Columbia Pictures"],"production_companies":[{"name":"Original Film"},{"name":"Columbia Pictures"}],"cast":["Leelee Sobieski","Diane Lane","Stellan Skarsgård","Trevor Morgan","Chris Noth"],"backdrop_path":"https://image.tmdb.org/t/p/original/r0ZAhYrmidOZuPgZZ2vDfNC2ddd.jpg","poster_path":"https://image.tmdb.org/t/p/original/hpyIEd02R0UmxImwdFwDKaqa8ZZ.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
