"517839":{"id":"517839","name":"Border","slug":"border","original_title":"Gräns","overview":"Tina (Eva Melander) é uma policial que, depois de ser atingida por um raio na infância, desenvolveu uma espécie de sexto sentido, fazendo com que seja capaz de “ler as pessoas” apenas pelo o olhar. Isso sempre foi uma vantagem na sua profissão, mas tudo muda quando ela identifica um criminoso e não consegue achar provas para justificar sua intuição. Após o episódio, ela passa a questionar seu dom, ao mesmo tempo em que fica obcecada em descobrir qual o verdadeiro segredo de Vore (Eero Milonoff), seu único suspeito não legitimado.","first_air_date":"2018-09-27","runtime":110,"episode_run_time":[110],"vote_average":6.7,"created_by":["Meta Film Stockholm","Black Spark Film & TV","Film i Väst","SVT","Meta Film","Copenhagen Film Fund","Kärnfilm"],"production_companies":[{"name":"Meta Film Stockholm"},{"name":"Black Spark Film & TV"},{"name":"Film i Väst"},{"name":"SVT"},{"name":"Meta Film"},{"name":"Copenhagen Film Fund"},{"name":"Kärnfilm"}],"cast":["Eva Melander","Eero Milonoff","Jörgen Thorsson","Ann Petrén","Sten Ljunggren"],"backdrop_path":"https://image.tmdb.org/t/p/original/blHx3LrXsIfefFggOk4gjwdX73i.jpg","poster_path":"https://image.tmdb.org/t/p/original/kVunpVd4Gb0FRD5EvTts0rg5vvk.jpg","certification":"N/A","genres":["Fantasia","Drama","Crime"],"trailer":"uFFdVdsUpJg"},
