"6973":{"id":"6973","name":"No Vale das Sombras","slug":"no-vale-das-sombras","original_title":"In the Valley of Elah","overview":"No 1º fim de semana após retornar do Iraque, Mike Deerfield (Jonathan Tucker) desaparece. Ele passa a ser considerado como foragido do exército, com seus pais, Hank (Tommy Lee Jones) e Joan (Susan Sarandon), sendo informados. Ao saber do caso Hank, que é um ex-policial militar, decide partir em busca do filho. Ele recebe a ajuda da detetive Emily Sanders (Charlize Theron), que trabalha na jurisdição onde Mike foi visto pela última vez. À medida que as investigações avançam o que era um caso de desaparecimento torna-se uma suspeita de assassinato, o que faz com que Emily tenha que enfrentar o alto escalão militar.","first_air_date":"2007-09-14","runtime":121,"episode_run_time":[121],"vote_average":6.8,"created_by":["Warner Independent Pictures","NALA Films","Summit Entertainment","Samuels Media","Blackfriars Bridge Films"],"production_companies":[{"name":"Warner Independent Pictures"},{"name":"NALA Films"},{"name":"Summit Entertainment"},{"name":"Samuels Media"},{"name":"Blackfriars Bridge Films"}],"cast":["Tommy Lee Jones","Charlize Theron","Susan Sarandon","Frances Fisher","James Franco"],"backdrop_path":"https://image.tmdb.org/t/p/original/2etSwBHCTcyFp9XOjZR4yYxqCC9.jpg","poster_path":"https://image.tmdb.org/t/p/original/2MLfTwQ47FfYNyDDXk5sP4OWE1l.jpg","certification":"N/A","genres":["História","Drama","Thriller","Crime","Mistério"],"trailer":"LBLYcQJkgvU"},
"787723":{"id":"787723","name":"13 Minutos de Tormenta","slug":"13-minutos-de-tormenta","original_title":"13 Minutes","overview":"Quando um novo dia começa na pequena cidade americana de Minninnewah, os residentes começam o dia tão comum quanto o seguinte. A Mãe Natureza, no entanto, tem outros planos para eles. Os habitantes têm apenas 13 minutos para buscar abrigo antes que o maior tornado já tenha devastado a cidade, deixando-os lutando para proteger seus entes queridos e lutando por suas vidas. Deixadas para lidar com as consequências, quatro famílias devem superar suas diferenças e encontrar forças umas nas outras para sobreviver.","first_air_date":"2021-10-29","runtime":108,"episode_run_time":[108],"vote_average":6.0,"created_by":["Elevated Films","Involving Pictures"],"production_companies":[{"name":"Elevated Films"},{"name":"Involving Pictures"}],"cast":["Trace Adkins","Yancey Arias","Thora Birch","Tokala Black Elk","Darryl Cox"],"backdrop_path":"https://image.tmdb.org/t/p/original/6oVyb2vnpXbc3fD47Hepe0HJ9uw.jpg","poster_path":"https://image.tmdb.org/t/p/original/c0Y2aNGSPlF7y926n2uHvPfo5TF.jpg","certification":"12","genres":["Ação","Drama","Thriller"],"trailer":"x4u83Xl8eZA"},
"4771":{"id":"4771","name":"Medo da Verdade","slug":"medo-da-verdade","original_title":"Gone Baby Gone","overview":"Ao lado da namorada, o detetive particular Patrick Kenzie se encarrega de uma difícil missão: localizar uma menina que foi sequestrada em Boston. O chefe de polícia Doyle não acredita que Patrick consiga encontrar a garota que já está desaparecida há mais de 76 horas. Mas o investigador não desiste e se prepara para enfrentar o perigo em um bairro violento da cidade.","first_air_date":"2007-09-18","runtime":114,"episode_run_time":[114],"vote_average":7.3,"created_by":["Miramax","The Ladd Company"],"production_companies":[{"name":"Miramax"},{"name":"The Ladd Company"}],"cast":["Casey Affleck","Michelle Monaghan","Morgan Freeman","Ed Harris","John Ashton"],"backdrop_path":"https://image.tmdb.org/t/p/original/xcDiiWTFJ6T3D3qayL1DdlDeQz8.jpg","poster_path":"https://image.tmdb.org/t/p/original/znK3nBCjkbdqQKPZbXE3zlcB9lC.jpg","certification":"16","genres":["Crime","Drama","Mistério"],"trailer":"N/A"},
