"1164":{"id":"1164","name":"Babel","slug":"babel","original_title":"Babel","overview":"Um ônibus repleto de turistas atravessa uma região montanhosa do Marrocos. Entre os viajantes estão Richard (Brad Pitt) e Susan (Cate Blanchett), um casal de americanos. Ali perto os meninos Ahmed (Said Tarchani) e Youssef (Boubker At El Caid) manejam um rifle que seu pai lhes deu para proteger a pequena criação de cabras da família. Um tiro atinge o ônibus, ferindo Susan. A partir daí o filme mostra como este fato afeta a vida de pessoas em vários pontos diferentes do mundo: nos Estados Unidos, onde Richard e Susan deixaram seus filhos aos cuidados da babá mexicana; no Japão, onde um homem (Kôji Yakusho) tenta superar a morte trágica de sua mulher e ajudar a filha surda (Rinko Kinkuchi) a aceitar a perda; no México, para onde a babá (Adriana Barraza) acaba levando as crianças; e ali mesmo, no Marrocos, onde a polícia passa a procurar suspeitos de um ato terrorista.","first_air_date":"2006-10-26","runtime":143,"episode_run_time":[143],"vote_average":7.2,"created_by":["Anonymous Content","Central Films","Zeta Film","MRC"],"production_companies":[{"name":"Anonymous Content"},{"name":"Central Films"},{"name":"Zeta Film"},{"name":"MRC"}],"cast":["菊地凛子","Adriana Barraza","Brad Pitt","Cate Blanchett","二階堂智"],"backdrop_path":"https://image.tmdb.org/t/p/original/dRk3A06MAZBud6RhAVgiMSbl4SB.jpg","poster_path":"https://image.tmdb.org/t/p/original/oUmiBeGYqp7QFfrXfmXT6YWjx0H.jpg","certification":"16","genres":["Drama"],"trailer":"N/A"},
