"1710":{"id":"1710","name":"Copycat - A Vida Imita a Morte","slug":"copycat-a-vida-imita-a-morte","original_title":"Copycat","overview":"Em São Francisco vive Helen Hudson (Sigourney Weaver), uma psiquiatra criminal que é especialista no comportamento de grandes serial killers mas sofre de agorafobia desde que foi atacada por um deles. Juntamente com M.J. Monahan (Holly Hunter), uma inspetora de polícia, ela luta contra o tempo para deter um serial killer que é discípulo do seu agressor e copia em seus crimes o modus operandi de famosos serial killers do passado.","first_air_date":"1995-10-27","runtime":124,"episode_run_time":[124],"vote_average":6.5,"created_by":["New Regency Pictures","Regency Enterprises","Warner Bros. Pictures"],"production_companies":[{"name":"New Regency Pictures"},{"name":"Regency Enterprises"},{"name":"Warner Bros. Pictures"}],"cast":["Sigourney Weaver","Holly Hunter","Dermot Mulroney","William McNamara","Harry Connick Jr."],"backdrop_path":"https://image.tmdb.org/t/p/original/f0wTYitK1lELuGygXslG7SQpY0E.jpg","poster_path":"https://image.tmdb.org/t/p/original/4jf2ZtreVJjog3b8zNkjvGVitv3.jpg","certification":"N/A","genres":["Thriller","Crime","Mistério","Terror","Drama"],"trailer":"N/A"},
