"88794":{"id":"88794","name":"J. Edgar","slug":"j-edgar","original_title":"J. Edgar","overview":"Drama biográfico sobre a vida pública e privada de J. Edgar Hoover, o controverso diretor e principal nome à frente da mais famosa agência de inteligência do mundo, o FBI, que foi oficialmente fundada em 1935, tornando-se uma eficiente ferramenta de combate ao crime. J. Edgar Hoover ocupou o cargo durante a gestão de oito presidentes americanos e foi o diretor da agência até sua morte, em 1972, aos 77 anos de idade. Hoover foi ao mesmo tempo temido e admirado, odiado e reverenciado; ficou conhecido por causa de seus critérios sempre discutíveis para perseguir ativistas políticos, congressistas e líderes do movimento negro, e ainda impôs seus métodos ilegais para criar arquivos secretos de líderes adversários. Consta na biografia de Hoover, também, sua suposta homossexualidade.","first_air_date":"2011-11-09","runtime":136,"episode_run_time":[136],"vote_average":6.2,"created_by":["Imagine Entertainment","Malpaso Productions","Wintergreen Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Imagine Entertainment"},{"name":"Malpaso Productions"},{"name":"Wintergreen Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Leonardo DiCaprio","Naomi Watts","Armie Hammer","Josh Lucas","Josh Hamilton"],"backdrop_path":"https://image.tmdb.org/t/p/original/sl7VRkF2bMGUBShAHgkWzTeOFlW.jpg","poster_path":"https://image.tmdb.org/t/p/original/hWHFPhGvCvfHbZCxJSR3n6GsXIf.jpg","certification":"12","genres":["Drama","Crime","História"],"trailer":"N/A"},
