"775":{"id":"775","name":"Viagem à Lua","slug":"viagem-a-lua","original_title":"Le Voyage dans la Lune","overview":"Uma associação de astrônomos concordou em ouvir o plano do professor Barbenfouillis, seu presidente, de voar para a lua. Com a única voz dissidente anulada por Barbenfouillis e os outros membros, o plano é aprovado com Barbenfouillis escolhendo cinco outros para acompanhá-lo. A maior parte da preparação para a viagem está na construção da embarcação e do mecanismo de lançamento, que se assemelha a uma bala grande e a uma arma grande, respectivamente.","first_air_date":"1902-06-15","runtime":14,"episode_run_time":[14],"vote_average":7.9,"created_by":["Star Film"],"production_companies":[{"name":"Star Film"}],"cast":["Georges Méliès","Bleuette Bernon","François Lallement","Henri Delannoy","Victor André"],"backdrop_path":"https://image.tmdb.org/t/p/original/g67r1eiQD3ERSEQFCFkSn7TeGw5.jpg","poster_path":"https://image.tmdb.org/t/p/original/fVSTQP2fTp8gex2TjTxvyN1C19e.jpg","certification":"N/A","genres":["Aventura","Ficção científica"],"trailer":"N/A"},
