"51822":{"id":"51822","name":"Amar te duele","slug":"amar-te-duele","original_title":"Amar te duele","overview":"Dois adolescents de diferentes classes sociais se conhecem em um luxuoso shopping e se apaixonam. Em sua apaixonada luta por esse amor impossível, eles se tornam vítimas de dois mundos opostos. Direcionado à juventude atual e mostrando situações e problemas comuns, o filme pretende provar que o amor ainda existe e que pode enfrentar qualquer preconceito.","first_air_date":"2002-11-08","runtime":104,"episode_run_time":[104],"vote_average":8.0,"created_by":["Altavista Films","Videocine"],"production_companies":[{"name":"Altavista Films"},{"name":"Videocine"}],"cast":["Luis Fernando Peña","Martha Higareda","Ximena Sariñana","Alfonso Herrera","Armando Hernández"],"backdrop_path":"https://image.tmdb.org/t/p/original/3obBVWeKVUh2LBtziL7SNR6yxOf.jpg","poster_path":"https://image.tmdb.org/t/p/original/eyhd9wLlyDTGOKl4jmzWy5sa90o.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"5902":{"id":"5902","name":"Uma Ponte Longe Demais","slug":"uma-ponte-longe-demais","original_title":"A Bridge Too Far","overview":"Setembro de 1944, os Aliados confidencialmente mandam para a Normandia um grande grupo de soldados para a operação Market Garden, cuja intenção era dar um fim para a Segunda Guerra Mundial, invadindo a Alemanha e destruindo as indústrias de guerra do 3º Reich. Durante a operação, disparidades políticas no campo de batalha, mó sorte nas condições meteorológicas e falhas na inteligência levam ao desastre da missão. A história do mais trágico erro tático da Segunda Guerra Mundial, que custou a vida de muitos soldados.","first_air_date":"1977-06-15","runtime":175,"episode_run_time":[175],"vote_average":7.2,"created_by":["United Artists","Joseph E. Levine Productions"],"production_companies":[{"name":"United Artists"},{"name":"Joseph E. Levine Productions"}],"cast":["Dirk Bogarde","James Caan","Michael Caine","Sean Connery","Edward Fox"],"backdrop_path":"https://image.tmdb.org/t/p/original/26feWH2NF8XqxuMzfkJTp9T5dfQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/swhlqqRywC1Tu4yaA4VGefpG384.jpg","certification":"N/A","genres":["Drama","História","Guerra"],"trailer":"N/A"},
