"6620":{"id":"6620","name":"Sabrina","slug":"sabrina","original_title":"Sabrina","overview":"Sabrina é a jovem filha do motorista da família Larrabee, que foi apaixonado por David Larrabee a vida toda. David é muito mimado e louco por mulheres, e ignorou a Sabrina durante anos. Sabrina vai para Paris por alguns anos e quando ela retorna é uma mulher muito atraente e sofisticada, e David fica rapidamente atraído por ela. Linus, o irmão de David, vê isso e teme que o casamento iminente de Davi com uma mulher muito rica pode estar ameaçado. Se o casamento for cancelado um grande negócio corporativo com a família da noiva também será cancelado. Então, Linus tenta manter Sabrina fora da vista de seu irmão, e a melhor maneira de fazer isso é ele mesmo cortejar Sabrina.","first_air_date":"1954-09-10","runtime":114,"episode_run_time":[114],"vote_average":7.5,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Audrey Hepburn","William Holden","Humphrey Bogart","Walter Hampden","John Williams"],"backdrop_path":"https://image.tmdb.org/t/p/original/ftNimlo6fP4WKRMWnF1ghX4fPUy.jpg","poster_path":"https://image.tmdb.org/t/p/original/8vvgKw3DbEPNlJAdHe7xXzhb2gN.jpg","certification":"e 12","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
