"803114":{"id":"803114","name":"O Tubarão: À Deriva","slug":"o-tubarao-a-deriva","original_title":"The Requin","overview":"Um casal de férias no Vietnã se encontram presos em mar aberto após uma enorme tempestade tropical levar sua casa à beira-mar. Com o marido machucado e morrendo, a esposa precisa lutar contra os elementos sozinha, enquanto são cercado por tubarões brancos abaixo.","first_air_date":"2022-01-28","runtime":89,"episode_run_time":[89],"vote_average":4.8,"created_by":["Film Bridge International","Paper Street Pictures","Saban Films"],"production_companies":[{"name":"Film Bridge International"},{"name":"Paper Street Pictures"},{"name":"Saban Films"}],"cast":["Alicia Silverstone","James Tupper","Deirdre O'Connell","Danny Chung","Jennifer Mudge"],"backdrop_path":"https://image.tmdb.org/t/p/original/eVSa4TpyXbOdk9fXSD6OcORJGtv.jpg","poster_path":"https://image.tmdb.org/t/p/original/sCoYlaYSvalyewEUcz1XW0J0USe.jpg","certification":"N/A","genres":["Terror","Mistério","Thriller"],"trailer":"N/A"},
"378385":{"id":"378385","name":"Soldado Anônimo 3: O Cerco","slug":"soldado-anonimo-3-o-cerco","original_title":"Jarhead 3: The Siege","overview":"Evan Albright (Charlie Weber) se junta ao grupo de elite do Corpo de Guardas de Segurança da Marinha em busca de salvar o mundo e ver um pouco mais de ação. Porém, sua primeira missão é proteger uma embaixada norte-america em uma capital do Oriente Médio que aparentemente é segura, fazendo a unidade passar tempo com pequenos grupos de revolta e jogos de mira. Albright e seu time são pegos de surpresa quando militares bem armados e treinados fazem um ataque surpresa.","first_air_date":"2016-01-20","runtime":95,"episode_run_time":[95],"vote_average":6.2,"created_by":["UFO International Productions","Universal 1440 Entertainment"],"production_companies":[{"name":"UFO International Productions"},{"name":"Universal 1440 Entertainment"}],"cast":["Scott Adkins","Sasha Jackson","Tom Ainsley","Dennis Haysbert","Charlie Weber"],"backdrop_path":"https://image.tmdb.org/t/p/original/sr55z05MvFdCooDif7xbjmwJUU3.jpg","poster_path":"https://image.tmdb.org/t/p/original/bc9BHYmTjkiPpr3xISgIz0ssgPv.jpg","certification":"18","genres":["Guerra","Ação","Drama"],"trailer":"N/A"},
"23172":{"id":"23172","name":"Missão Quase Impossível","slug":"missao-quase-impossivel","original_title":"The Spy Next Door","overview":"Bob Ho é um agente secreto da CIA, que decide largar o serviço para poder se dedicar mais a Gilliam, sua namorada. Bob deseja se casar com Gilliam mas antes tem uma missão complicada: conquistar Farren, Ian e Nora, os filhos dela. Ele tem sua grande chance quando Gilliam precisa viajar de última hora, deixando as crianças sob seus cuidados. Só que uma das crianças faz, por engano, o download de uma fórmula secreta que está no computador de Bob. Esta é a chance aguardada por seus inimigos para atacá-lo.","first_air_date":"2010-01-15","runtime":94,"episode_run_time":[94],"vote_average":5.9,"created_by":["Spy Next Door","Relativity Media","Robert Simonds Productions","Lionsgate","Mandate International"],"production_companies":[{"name":"Spy Next Door"},{"name":"Relativity Media"},{"name":"Robert Simonds Productions"},{"name":"Lionsgate"},{"name":"Mandate International"}],"cast":["Jackie Chan","Amber Valletta","Madeline Carroll","Will Shadley","Alina Foley"],"backdrop_path":"https://image.tmdb.org/t/p/original/w7TUrUUo9pKcgY7PCdm2LK6XbZB.jpg","poster_path":"https://image.tmdb.org/t/p/original/ccoL6SB1efI9epaLrqxwHVZ8uKN.jpg","certification":"10","genres":["Ação","Comédia","Família"],"trailer":"N/A"},
"43933":{"id":"43933","name":"Monstros","slug":"monstros","original_title":"Monsters","overview":"Há 6 anos atrás a NASA enviou uma sonda para o espaço para recolher amostras de possível vida alienígena. Ao regressar a sonda caiu na América Central, e pouco tempo depois uma nova forma de vida apareceu no México, colocando metade do México com zona de quarentena na tentativa de conter as criaturas.","first_air_date":"2010-06-18","runtime":94,"episode_run_time":[94],"vote_average":6.2,"created_by":["Vertigo Films","Protagonist Pictures"],"production_companies":[{"name":"Vertigo Films"},{"name":"Protagonist Pictures"}],"cast":["Scoot McNairy","Whitney Able","Mario Zuniga Benavides","Annalee Jefferies","Justin Hall"],"backdrop_path":"https://image.tmdb.org/t/p/original/imiBIsvNU3TbMB3sbqKanKODS33.jpg","poster_path":"https://image.tmdb.org/t/p/original/5a4z5VpHWzfvXpobzqB7or81Rgn.jpg","certification":"N/A","genres":["Drama","Thriller","Ficção científica"],"trailer":"N/A"},
