"339988":{"id":"339988","name":"O Círculo","slug":"o-circulo","original_title":"The Circle","overview":"Mae é uma universitária cujo sonho é trabalhar na maior empresa de tecnologia do mundo, O Círculo. A organização foi fundada por Eamon Bailey e o seu principal produto é o SeeChange, uma pequena câmera que permite aos usuários compartilharem detalhes de suas vidas com o mundo. Mae vê sua vida mudar completamente quando é contratada pela empresa e sua função passa a ser documentar sua vida em tempo integral. O que ela não imaginava, no entanto, é que toda essa exposição teria um preço, não só para ela, mas também para todos ao seu redor.","first_air_date":"2017-04-27","runtime":110,"episode_run_time":[110],"vote_average":5.5,"created_by":["Parkes+MacDonald Image Nation","Route One Entertainment","Playtone","Likely Story","1978 Films","Image Nation Abu Dhabi"],"production_companies":[{"name":"Parkes+MacDonald Image Nation"},{"name":"Route One Entertainment"},{"name":"Playtone"},{"name":"Likely Story"},{"name":"1978 Films"},{"name":"Image Nation Abu Dhabi"}],"cast":["Emma Watson","Tom Hanks","John Boyega","Karen Gillan","Ellar Coltrane"],"backdrop_path":"https://image.tmdb.org/t/p/original/2NGBchckkORvJ94ojJWQDqgVvEX.jpg","poster_path":"https://image.tmdb.org/t/p/original/fHOLNgnV82ZXleXESKJoKtaWYxx.jpg","certification":"12","genres":["Drama","Thriller","Ficção científica"],"trailer":"jTDuHE8usuk"},
