"44639":{"id":"44639","name":"Trabalho Interno","slug":"trabalho-interno","original_title":"Inside Job","overview":"A crise financeira mundial que aconteceu em 2008, causou a perda de milhões de empregos e casas e mergulhou os Estados Unidos em uma profunda recessão econômica. Matt Damon narra um documentário que fornece uma análise detalhada dos elementos que levaram ao colapso e identifica peças-chave do mundo financeiro e político. O diretor Charles Ferguson realiza uma gama de entrevistas e traça a história dos Estados Unidos para a China para a Islândia e para outros mercados financeiros mundiais.","first_air_date":"2010-10-08","runtime":105,"episode_run_time":[105],"vote_average":7.7,"created_by":["Sony Pictures"],"production_companies":[{"name":"Sony Pictures"}],"cast":["Matt Damon","William Ackman","Barack Obama","George W. Bush","Jonathan Alpert"],"backdrop_path":"https://image.tmdb.org/t/p/original/1yFmxvVYgVrFKL2ksFzgX0MrWOM.jpg","poster_path":"https://image.tmdb.org/t/p/original/7O7DBUqbD1z7lhjC9VP95scA1Dt.jpg","certification":"12","genres":["Documentário","Crime"],"trailer":"N/A"},
"28597":{"id":"28597","name":"O Pestinha 2","slug":"o-pestinha-2","original_title":"Problem Child 2","overview":"Recém divorciado, Ben e seu filho Junior mudam-se para uma nova cidade onde existem muitas mulheres separadas disponíveis. Logo elas tratam de fazer fila na porta de Ben, enquanto Junior tortura seus vizinhos e colegas de classe com suas travessuras cruéis. Uma divorciada persistente consegue colocar suas garras no novo solteirão da cidade, apesar do amor dele por uma bela enfermeira, e os dois concordam em se casar. Agora Junior e sua amiga Trixie, filha da enfermeira, precisam impedir o casamento a qualquer custo.","first_air_date":"1991-07-03","runtime":90,"episode_run_time":[90],"vote_average":5.9,"created_by":["Imagine Entertainment","Universal Pictures"],"production_companies":[{"name":"Imagine Entertainment"},{"name":"Universal Pictures"}],"cast":["John Ritter","Michael J. Oliver","Jack Warden","Laraine Newman","Amy Yasbeck"],"backdrop_path":"https://image.tmdb.org/t/p/original/eMQ8pdAgOQ3LHpyylkm5F51OChW.jpg","poster_path":"https://image.tmdb.org/t/p/original/8IHLYVF7Pl7GflinQh2TW8cnN8m.jpg","certification":"N/A","genres":["Comédia","Família"],"trailer":"N/A"},
"10911":{"id":"10911","name":"Os Canhões de Navarone","slug":"os-canhoes-de-navarone","original_title":"The Guns of Navarone","overview":"Na Grécia de 1943, dois mil soldados britânicos estão perdidos em Kheros. Eles têm apenas uma semana para fugir antes de uma demonstração de força nazista no Mar Egeu, que poderia dominá-los facilmente. Para escapar, um grupo aliado precisa invadir uma fortaleza em Navarone e destruir dois canhões que bloqueiam a única rota de fuga. O sucesso dessa missão é crucial para resgatar os soldados britânicos e evitar um desastre para os aliados.","first_air_date":"1961-04-27","runtime":158,"episode_run_time":[158],"vote_average":7.3,"created_by":["Highroad Productions","Columbia Pictures"],"production_companies":[{"name":"Highroad Productions"},{"name":"Columbia Pictures"}],"cast":["Gregory Peck","David Niven","Anthony Quinn","Stanley Baker","Anthony Quayle"],"backdrop_path":"https://image.tmdb.org/t/p/original/hgFyxEtHCMDJQc2TdXSl3FGIs2.jpg","poster_path":"https://image.tmdb.org/t/p/original/sWOcOmSdKXKsjgf3FLR2asyK68r.jpg","certification":"N/A","genres":["Guerra","Aventura","Thriller","Ação"],"trailer":"N/A"},
