"298382":{"id":"298382","name":"A Vingança Está na Moda","slug":"a-vinganca-esta-na-moda","original_title":"The Dressmaker","overview":"Tilly Dunnage fugiu da cidade rural em que vivia na Austrália depois de ser acusada de ter se envolvido em um assassinato. Ela parte para a Europa e lá conquista fama e reconhecimento por seu trabalho na alta costura. Decidida a acertar as contas com seu passado, Tilly retorna para casa, transformada em uma mulher atraente e sofisticada. Com sua máquina de costura e estilo haute couture, ela transforma a vida das mulheres e chama a atenção dos homens, em especial de um jovem (Liam Hemsworth). Logo, ela demanda a doce vingança de quem por anos duvidou de sua palavra.","first_air_date":"2015-10-29","runtime":118,"episode_run_time":[118],"vote_average":7.0,"created_by":["White Hot Productions","Screen Australia","Film Art Media","Embankment Films","Ingenious Media","Universal Pictures"],"production_companies":[{"name":"White Hot Productions"},{"name":"Screen Australia"},{"name":"Film Art Media"},{"name":"Embankment Films"},{"name":"Ingenious Media"},{"name":"Universal Pictures"}],"cast":["Kate Winslet","Liam Hemsworth","Caroline Goodall","Judy Davis","Hayley Magnus"],"backdrop_path":"https://image.tmdb.org/t/p/original/pOd5ZQxZEORCg39ISnqpUI0XIhg.jpg","poster_path":"https://image.tmdb.org/t/p/original/fXNobPTdS2sDUTFGd6j4A7bluog.jpg","certification":"12","genres":["Drama","Comédia","Faroeste"],"trailer":"N/A"},
"425505":{"id":"425505","name":"Kin","slug":"kin","original_title":"Kin","overview":"Um ex-condenado e seu irmão mais novo são forçados a fugir de um vingativo criminoso, federais e uma série de soldados de outro mundo. A única proteção que eles possuem é uma arma de procedência misteriosa. Enquanto coisas estranhas acontecem com os irmãos, uma agente do FBI (Carrie Coon) é chamada para investigar o caso.","first_air_date":"2018-08-29","runtime":102,"episode_run_time":[102],"vote_average":6.1,"created_by":["21 Laps Entertainment","No Trace Camping","Lionsgate","Summit Entertainment","Good Universe","Endeavor Content"],"production_companies":[{"name":"21 Laps Entertainment"},{"name":"No Trace Camping"},{"name":"Lionsgate"},{"name":"Summit Entertainment"},{"name":"Good Universe"},{"name":"Endeavor Content"}],"cast":["Myles Truitt","Jack Reynor","Dennis Quaid","Zoë Kravitz","James Franco"],"backdrop_path":"https://image.tmdb.org/t/p/original/7oZR0oaFOPrzGkg3ZntEKwMCLTe.jpg","poster_path":"https://image.tmdb.org/t/p/original/yyM6NktVICFnRj7tyvYBMUUq6g3.jpg","certification":"14","genres":["Ficção científica","Ação","Aventura","Thriller"],"trailer":"N/A"},
