"9314":{"id":"9314","name":"1984","slug":"1984","original_title":"Nineteen Eighty-Four","overview":"Um homem perde sua identidade vivendo sob um regime repressivo. Nesta história baseada no clássico de George Orwell, Winston Smith (John Hurt) é um funcionário público cuja função é reescrever a história de forma a colocar os líderes de um país fictício sob uma luz positiva. As escapadelas românticas com Julia (Suzanna Hamilton) proporcionam sua única fonte de distração, mas os políticos desaprovam o relacionamento. Em uma sociedade monitorada de perto, não há como escapar do Grande Irmão.","first_air_date":"1984-11-09","runtime":113,"episode_run_time":[113],"vote_average":6.8,"created_by":["Atlantic Releasing Corporation","Umbrella-Rosenblum Film Production","Virgin Benelux","Virgin Schallplatten","Virgin Films","20th Century Fox"],"production_companies":[{"name":"Atlantic Releasing Corporation"},{"name":"Umbrella-Rosenblum Film Production"},{"name":"Virgin Benelux"},{"name":"Virgin Schallplatten"},{"name":"Virgin Films"},{"name":"20th Century Fox"}],"cast":["John Hurt","Richard Burton","Suzanna Hamilton","Cyril Cusack","Gregor Fisher"],"backdrop_path":"https://image.tmdb.org/t/p/original/st86fikqFNE4reqFNHRqeIsaxMj.jpg","poster_path":"https://image.tmdb.org/t/p/original/hrdQlicxuyTg3zyVqq78EsA4Z6J.jpg","certification":"14","genres":["Drama","Ficção científica"],"trailer":"N/A"},
