"228973":{"id":"228973","name":"Sobrevivente","slug":"sobrevivente","original_title":"Backcountry","overview":"Jenn, uma executiva que vive ocupada, é, finalmente, convencida pelo seu namorado Alex a embarcar com ele em uma viagem para o campo, a fim de fugir das pressões da cidade grande. Após um inquietante encontro com um estranho homem, Brad, em sua primeira noite no meio da floresta, eles seguem viagem. Mas depois de três dias, os dois se encontram perdidos, sem comida ou água. Até que eles percebem que entraram no território de um urso predatório.","first_air_date":"2015-03-20","runtime":92,"episode_run_time":[92],"vote_average":5.9,"created_by":["Fella Films"],"production_companies":[{"name":"Fella Films"}],"cast":["Missy Peregrym","Jeff Roop","Eric Balfour","Nicholas Campbell"],"backdrop_path":"https://image.tmdb.org/t/p/original/fX8OjnkkWnGJdQ7tkpf8z7la4Xu.jpg","poster_path":"https://image.tmdb.org/t/p/original/i87ZhhIXO4Z15np1lhGNQXLzwBS.jpg","certification":"14","genres":["Terror","Thriller","Drama"],"trailer":"N/A"},
"961484":{"id":"961484","name":"Caça Implacável","slug":"caca-implacavel","original_title":"Last Seen Alive","overview":"Will Spann leva de carro Lisa, prestes a ser sua ex-mulher, a casa dos pais quando, de forma misteriosa, ela desaparece numa bomba de gasolina. Desesperado para a encontrar, Will recorre à Polícia, que não só não o ajuda como desconfia dele. Determinado a encontrar Lisa a qualquer custo, Will mergulha no submundo da cidade enquanto foge das autoridades nesta corrida angustiante contra o tempo.","first_air_date":"2022-05-12","runtime":95,"episode_run_time":[95],"vote_average":6.4,"created_by":["Voltage Pictures","Perfection Hunter Productions","G-BASE","Marc Frydman Productions"],"production_companies":[{"name":"Voltage Pictures"},{"name":"Perfection Hunter Productions"},{"name":"G-BASE"},{"name":"Marc Frydman Productions"}],"cast":["Gerard Butler","Jaimie Alexander","Russell Hornsby","Ethan Embry","Michael Irby"],"backdrop_path":"https://image.tmdb.org/t/p/original/nAHysRXM17o6TurhobGtL1MCDDH.jpg","poster_path":"https://image.tmdb.org/t/p/original/56mBlJ55Z1O9oIOhRTAGIHZHXP7.jpg","certification":"16","genres":["Ação","Thriller"],"trailer":"nYsOfH8rTaE"},
"8388":{"id":"8388","name":"Três Amigos!","slug":"tres-amigos","original_title":"¡Three Amigos!","overview":"Quando uma pequena vila mexicana é aterrorizada por um conhecido fora-da-lei, uma jovem desesperada decide chamar os únicos heróis que ela conhece: Os legendários \"Três Amigos!\". Conhecidos por todos como intrépidos defensores da liberdade, estes corajosos vaqueiros de fato não passam de atores de cinema. Outrora famosos por seus filmes de faroeste, hoje eles estão desempregados e embora as únicas lutas de que já participaram na vida tenham acontecido apenas nos sets de filmagem, quando os criminosos atacam, os \"Três Amigos!\" descobrem que os bandidos e as balas de suas armas são bem reais!","first_air_date":"1986-12-12","runtime":104,"episode_run_time":[104],"vote_average":6.3,"created_by":["L.A. Films","Orion Pictures","HBO","Orion"],"production_companies":[{"name":"L.A. Films"},{"name":"Orion Pictures"},{"name":"HBO"},{"name":"Orion"}],"cast":["Chevy Chase","Steve Martin","Martin Short","Alfonso Arau","Tony Plana"],"backdrop_path":"https://image.tmdb.org/t/p/original/z7VhtN4xkedXaQPGUevRMK7wo9M.jpg","poster_path":"https://image.tmdb.org/t/p/original/5BlxocUtfFfpG1QJS7F4FtH6mZ0.jpg","certification":"N/A","genres":["Comédia","Faroeste","Drama"],"trailer":"N/A"},
