"9384":{"id":"9384","name":"Starsky & Hutch: Justiça em Dobro","slug":"starsky-hutch-justica-em-dobro","original_title":"Starsky & Hutch","overview":"David Starsky e Ken Hutchinson são dois policiais que, em plena década de 70, trabalham na cidade de Bay City. Starsky e Hutch sempre são designados para investigar os casos mais complicados de sua área, sendo que desta vez eles precisam investigar um traficante de drogas que atua no ramo desde seus tempos de estudante na universidade local. Para tanto eles contam com a ajuda do capitão Doby e de Huggy Bear, um informante das ruas.","first_air_date":"2004-03-05","runtime":101,"episode_run_time":[101],"vote_average":5.8,"created_by":["Warner Bros. Pictures","Dimension Films","Riche-Ludwig Productions","Weed Road Pictures","Red Hour"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Dimension Films"},{"name":"Riche-Ludwig Productions"},{"name":"Weed Road Pictures"},{"name":"Red Hour"}],"cast":["Ben Stiller","Owen Wilson","Snoop Dogg","Vince Vaughn","Fred Williamson"],"backdrop_path":"https://image.tmdb.org/t/p/original/k6Qnu4fTXskJwjFBEZRtTPSLHu9.jpg","poster_path":"https://image.tmdb.org/t/p/original/tMO1gC5HI45JDJLt8jNTxwee6Ha.jpg","certification":"14","genres":["Comédia","Crime"],"trailer":"N/A"},
