"113947":{"id":"113947","name":"As Sessões","slug":"as-sessoes","original_title":"The Sessions","overview":"Mark O'Brien (John Hawkes) é um escritor e poeta que, ainda criança, contraiu poliomielite. Devido à doença ele perdeu os movimentos do corpo, com exceção da cabeça, e precisa passar boa parte do dia dentro de um aparelho apelidado de \"pulmão de aço\". Mark passa os dias entre o trabalho e as visitas à igreja, onde conversa com o padre Brendan (William H. Macy), seu amigo pessoal. Sentindo-se incompleto por desconhecer o sexo, Mark passa a frequentar uma terapeuta sexual. Ela lhe indica os serviços de Cheryl Cohen Greene (Helen Hunt), uma especialista em exercícios de consciência corporal, que o inicia no sexo.","first_air_date":"2012-05-02","runtime":95,"episode_run_time":[95],"vote_average":6.9,"created_by":["Such Much Films","Rhino Films"],"production_companies":[{"name":"Such Much Films"},{"name":"Rhino Films"}],"cast":["John Hawkes","Helen Hunt","William H. Macy","Moon Bloodgood","Annika Marks"],"backdrop_path":"https://image.tmdb.org/t/p/original/6P6YdvJsAZlUZKipA86rbfjfKzD.jpg","poster_path":"https://image.tmdb.org/t/p/original/wlwCDIeQsigLuot49133OklCozD.jpg","certification":"16 anos","genres":["Drama","Romance","Comédia"],"trailer":"N/A"},
"698948":{"id":"698948","name":"Treze Vidas: O Resgate","slug":"treze-vidas-o-resgate","original_title":"Thirteen Lives","overview":"Enfrentando probabilidades insuperáveis, uma equipe composta pelos mergulhadores mais habilidosos e experientes do mundo se junta às forças tailandesas e mais de 10.000 voluntários para tentar um resgate angustiante de doze meninos e seu treinador de um time de futebol que ficou preso na caverna Tham Luang durante uma tempestade inesperada. Com apostas impossivelmente altas e o mundo inteiro assistindo, o grupo embarca em seu mergulho mais desafiador até agora, mostrando a imensidão do espírito humano no processo.","first_air_date":"2022-07-18","runtime":147,"episode_run_time":[147],"vote_average":7.9,"created_by":["Imagine Entertainment","Storyteller Productions","Magnolia Mae Films","Metro-Goldwyn-Mayer","Bron Studios"],"production_companies":[{"name":"Imagine Entertainment"},{"name":"Storyteller Productions"},{"name":"Magnolia Mae Films"},{"name":"Metro-Goldwyn-Mayer"},{"name":"Bron Studios"}],"cast":["Viggo Mortensen","Colin Farrell","Joel Edgerton","Tom Bateman","Paul Gleeson"],"backdrop_path":"https://image.tmdb.org/t/p/original/tHR34A5n0my4maACNdLpWGd6QYq.jpg","poster_path":"https://image.tmdb.org/t/p/original/8sO4gjzLhxndxLtMrohGV2DD2Rw.jpg","certification":"12","genres":["Drama","Thriller"],"trailer":"9yPS2zU2CWg"},
