"12187":{"id":"12187","name":"Morrendo e Aprendendo","slug":"morrendo-e-aprendendo","original_title":"Heart and Souls","overview":"São Francisco, 1959. Um distraído motorista de ônibus, Hal, provoca um acidente no qual ele e mais quatro passageiros morrem: Harrison, Penny, Julia e Milo. Apesar de o causador do acidente ter ido diretamente para o Céu, o mesmo não aconteceu com as outras vítimas porque no exato momento do acidente nascia uma criança chamada Thomas, em um carro próximo ao local. Por essa razão, as quatro almas ficaram ligadas de alguma forma ao pequenino, que passou a ser o único que podia vê-los e ainda interagir com eles. Conforme o tempo foi passando, eles começaram a acreditar que estariam atrapalhando o crescimento do menino e decidiram sumir de sua vida dele. Anos mais tarde, o motorista retorna à Terra para levar as almas dos passageiros. É quando eles descobrem que o objetivo de terem ficado era para concluir coisas inacabadas de sua vidas, abreviadas pelo acidente.","first_air_date":"1993-08-13","runtime":104,"episode_run_time":[104],"vote_average":6.9,"created_by":["Alphaville Films","Stampede Entertainment","Universal Pictures"],"production_companies":[{"name":"Alphaville Films"},{"name":"Stampede Entertainment"},{"name":"Universal Pictures"}],"cast":["Robert Downey Jr.","Charles Grodin","Alfre Woodard","Kyra Sedgwick","Tom Sizemore"],"backdrop_path":"https://image.tmdb.org/t/p/original/orjpvbnfiDQvqRJIy9cLAb8WTgF.jpg","poster_path":"https://image.tmdb.org/t/p/original/gSqaYO4MO57nLZqnod4N2BWV02Q.jpg","certification":"N/A","genres":["Fantasia","Comédia","Romance"],"trailer":"N/A"},
