"22094":{"id":"22094","name":"Lutador de Rua","slug":"lutador-de-rua","original_title":"Hard Times","overview":"Durante a Grande Depressão, um desempregado se une a um promotor de lutas de rua para poder sobreviver. Falando pouco e lutando muito, ele consegue vitórias expressivas e uma razoável quantia. Porém seu empresário, que ganhou tanto quanto ele, se encontra em sérias dificuldades financeiras. Os dois acabam se desentendendo e se separando, mas a única chance do seu antigo promotor se salvar desta situação é convencê-lo a participar de uma grande luta sem público, com um lutador de Chicago.","first_air_date":"1975-08-13","runtime":93,"episode_run_time":[93],"vote_average":6.8,"created_by":["Columbia Pictures","Claridge Productions","Major Studio Partners"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Claridge Productions"},{"name":"Major Studio Partners"}],"cast":["Charles Bronson","James Coburn","Jill Ireland","Strother Martin","Margaret Blye"],"backdrop_path":"https://image.tmdb.org/t/p/original/cjA8bxjXcw3I63DlO3qa6uFwrH4.jpg","poster_path":"https://image.tmdb.org/t/p/original/mbW50JBi0npx5nRY0TahvBquZaC.jpg","certification":"N/A","genres":["Drama","Ação","Crime"],"trailer":"N/A"},
