"34806":{"id":"34806","name":"Plano B","slug":"plano-b","original_title":"The Back-Up Plan","overview":"Zoe está cansada de aguardar pelo homem certo. Decidida a ser mãe de qualquer maneira, ela elabora um plano, marca uma consulta e resolve fazer inseminação artificial. Neste mesmo dia conhece Stan, que surge como uma possibilidade real de relacionamento. Só que Zoe quer manter o relacionamento no nível da amizade, ao mesmo tempo em que precisa esconder os primeiros sinais da gravidez. Quando enfim revela a verdade, Stan lhe diz que está disposto a encarar a situação.","first_air_date":"2010-04-23","runtime":104,"episode_run_time":[104],"vote_average":6.1,"created_by":["Escape Artists","CBS Films"],"production_companies":[{"name":"Escape Artists"},{"name":"CBS Films"}],"cast":["Jennifer Lopez","Alex O'Loughlin","Michaela Watkins","Eric Christian Olsen","Anthony Anderson"],"backdrop_path":"https://image.tmdb.org/t/p/original/fudUJZpEKRhFVzYz8iIIO7Wnvtw.jpg","poster_path":"https://image.tmdb.org/t/p/original/5oYVyLDfdIVoXhDHgo6WBwU9KMw.jpg","certification":"12","genres":["Comédia","Romance"],"trailer":"fOMG_4qTnaI"},
"4858":{"id":"4858","name":"Invasores","slug":"invasores","original_title":"The Invasion","overview":"A colisão de um ônibus espacial faz com que algo alienígena penetre em seus destroços, sendo que todos que entram em contato mudam de maneira inexplicável. A psiquiatra Carol Bennell (Nicole Kidman) e seu colega Ben Driscoll (Daniel Craig) descobrem que a epidemia alienígena ataca suas vítimas quando elas estão dormindo. A epidemia não altera fisicamente suas vítimas, mas faz com que as pessoas fiquem insensíveis e sem qualquer traço de humanidade. À medida que a epidemia se espalha fica cada vez mais difícil saber quem está infectado. Para sobreviver Carol precisa ficar acordada o maior tempo possível, para que possa encontrar seu filho.","first_air_date":"2007-08-17","runtime":99,"episode_run_time":[99],"vote_average":6.0,"created_by":["Village Roadshow Pictures","Silver Pictures","Vertigo Entertainment"],"production_companies":[{"name":"Village Roadshow Pictures"},{"name":"Silver Pictures"},{"name":"Vertigo Entertainment"}],"cast":["Nicole Kidman","Daniel Craig","Jackson Bond","Jeremy Northam","Jeffrey Wright"],"backdrop_path":"https://image.tmdb.org/t/p/original/qiCzhx0mu2ojmIL30iXe6H4abTF.jpg","poster_path":"https://image.tmdb.org/t/p/original/3zDDAOIi8fTnWsqkwfRCYGT3l0s.jpg","certification":"N/A","genres":["Terror","Mistério","Ficção científica","Thriller"],"trailer":"N/A"},
"11551":{"id":"11551","name":"Pequenos Guerreiros","slug":"pequenos-guerreiros","original_title":"Small Soldiers","overview":"Globotech é um grande conglomerado que, entre outras atividades, faz armas para o Departamento de Defesa dos Estados Unidos. Decidida a investir em outros ramos, ela compra a Heartland, uma fábrica de brinquedos. Gil Mars, o presidente geral, quer que os designers façam brinquedos mais realistas, que tenham praticamente vida própria e usem bateria de lítio, para nunca precisarem de pilhas. Depois de três meses os brinquedos estão prontos e o resultado são figuras de ferozes soldados - o Comando Elite - que foi programado para destruir os Gorgonóides, alienígenas que não oferecem nenhum perigo. Joe, um entregador da Heartland, deixa alguns destes brinquedos na pequena loja de Stuart Abernathy, que está indo à falência. À noite o Comando Elite sai de suas caixas e recebe ordem do seu líder, Chip Hazard, para atacar os Gorgonóides e os humanos.","first_air_date":"1998-07-10","runtime":110,"episode_run_time":[110],"vote_average":6.5,"created_by":["DreamWorks Pictures","Universal Pictures","Amblin Entertainment"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"Universal Pictures"},{"name":"Amblin Entertainment"}],"cast":["Gregory Smith","Kirsten Dunst","Denis Leary","Phil Hartman","David Cross"],"backdrop_path":"https://image.tmdb.org/t/p/original/l4RtVcfyCEbH6XfTn9Rv5OUuEM6.jpg","poster_path":"https://image.tmdb.org/t/p/original/gj8CC9rtLYtFWplt66x7A14bRsP.jpg","certification":"L","genres":["Comédia","Aventura","Fantasia","Ficção científica","Ação"],"trailer":"N/A"},
"9600":{"id":"9600","name":"Vovó... Zona","slug":"vovo-zona","original_title":"Big Momma's House","overview":"O agente do FBI Malcolm Turner é duro, inteligente e um mestre dos disfarces. Não há nada em que ele não possa se disfarçar. A mais recente missão de Malcolm é numa pequena cidade sulista, onde ele deve capturar um perigoso assaltante de banco que fugiu recentemente da prisão. Para tanto, Malcolm arma uma tocaia em frente à casa de uma matriarca conhecida como Vovózona, que está para receber a visita da última namorada do ladrão, Sherry, e seu filho. Só que surge um problema: inesperadamente Vovózona deixa a cidade. Para levar adiante seu plano, Malcolm resolve ele mesmo se disfarçar de Vovó para poder capturar o assaltante.","first_air_date":"2000-05-31","runtime":99,"episode_run_time":[99],"vote_average":5.8,"created_by":["Regency Enterprises","20th Century Fox","Taurus Film"],"production_companies":[{"name":"Regency Enterprises"},{"name":"20th Century Fox"},{"name":"Taurus Film"}],"cast":["Martin Lawrence","Nia Long","Paul Giamatti","Jascha Washington","Terrence Howard"],"backdrop_path":"https://image.tmdb.org/t/p/original/wAmg1DdrJgHYE4I3K2IVv1S5orO.jpg","poster_path":"https://image.tmdb.org/t/p/original/us9UowVdxrH0l4bVleBeCVMsW2i.jpg","certification":"12","genres":["Crime","Comédia"],"trailer":"N/A"},
"1083658":{"id":"1083658","name":"A Grande Entrevista","slug":"a-grande-entrevista","original_title":"Scoop","overview":"Inspirado em eventos reais, ‘Scoop’ é o relato interno do jornalismo corajoso que rendeu uma entrevista devastadora – a infame aparição do príncipe Andrew na BBC Newsnight. Da tensão das negociações de alto risco da produtora Sam McAlister com o Palácio de Buckingham, até o confronto forense de cair o queixo de Emily Maitlis com o Príncipe, ‘Scoop’ nos leva para dentro da história, com as mulheres que não parariam por nada para consegui-la. Para conseguir uma entrevista tão grande, você tem que ser ousado.","first_air_date":"2024-03-27","runtime":102,"episode_run_time":[102],"vote_average":6.4,"created_by":["The Lighthouse","Voltage TV"],"production_companies":[{"name":"The Lighthouse"},{"name":"Voltage TV"}],"cast":["Gillian Anderson","Billie Piper","Rufus Sewell","Keeley Hawes","Romola Garai"],"backdrop_path":"https://image.tmdb.org/t/p/original/c2vhEOVNoXeEXUkiLhBsP3mIcQe.jpg","poster_path":"https://image.tmdb.org/t/p/original/jUurIBIrzirFZErIp1XWgIxWZ9f.jpg","certification":"16","genres":["Drama"],"trailer":"5-29vlqgW-4"},
