"11072":{"id":"11072","name":"Banzé no Oeste","slug":"banze-no-oeste","original_title":"Blazing Saddles","overview":"Rock Ridge é uma pequena cidade do oeste americano onde todos os seus moradores se chamam Johnson. A estrada de ferro está prestes a passar pelo local, o que faz com que Hedley Lamarr (Harvey Korman) aterrorize os moradores. Sua intenção é obter as terras da cidade, que serão bastante valorizadas após a conclusão das obras. Para controlar a situação, o governador William J. Lepetomane (Mel Brooks) contrata um novo xerife, Bart (Cleavon Little). Só que Bart é negro e passa a ser hostilizado pela população racista. Ele recebe apenas a ajuda de Jim (Gene Wilder), conhecido como The Waco Kid, o pistoleiro bêbado mais rápido da região.","first_air_date":"1974-02-07","runtime":93,"episode_run_time":[93],"vote_average":7.2,"created_by":["Crossbow Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Crossbow Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Cleavon Little","Gene Wilder","Slim Pickens","Harvey Korman","Madeline Kahn"],"backdrop_path":"https://image.tmdb.org/t/p/original/syUzOlwPqM8pGRhUxPOnmrcGcHb.jpg","poster_path":"https://image.tmdb.org/t/p/original/tgPPqdMgOutIGmUnnhJi4uXgtrg.jpg","certification":"N/A","genres":["Faroeste","Comédia"],"trailer":"N/A"},
