"343":{"id":"343","name":"Ensina-me a Viver","slug":"ensina-me-a-viver","original_title":"Harold and Maude","overview":"O relacionamento entre um rapaz de 20 anos com obsessão pela morte, que passa seu tempo indo a funerais ou simulando suicídios, e uma senhora de 79 anos encantada com a vida. Eles passam muito tempo juntos e, durante esta convivência, ela expõe a beleza da vida.","first_air_date":"1971-12-20","runtime":91,"episode_run_time":[91],"vote_average":7.6,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Ruth Gordon","Bud Cort","Vivian Pickles","Cyril Cusack","Charles Tyner"],"backdrop_path":"https://image.tmdb.org/t/p/original/wQtOi6joqqjSaFKikVxrq5l21b5.jpg","poster_path":"https://image.tmdb.org/t/p/original/hOqcJ82tPemMZSitQ9ZO4XJIU3H.jpg","certification":"14","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
"160588":{"id":"160588","name":"Blue Jasmine","slug":"blue-jasmine","original_title":"Blue Jasmine","overview":"Uma milionária mulher perde todo seu dinheiro e é obrigada a morar em São Francisco com sua irmã e os sobrinhos em uma casa bem modesta. Ela acaba encontrando um refinado homem que pode resolver seus problemas financeiros, mas antes precisa descobrir quem é e aceitar sua nova condição de vida.","first_air_date":"2013-08-01","runtime":99,"episode_run_time":[99],"vote_average":7.0,"created_by":["Gravier Productions","Perdido Productions"],"production_companies":[{"name":"Gravier Productions"},{"name":"Perdido Productions"}],"cast":["Cate Blanchett","Sally Hawkins","Alec Baldwin","Peter Sarsgaard","Bobby Cannavale"],"backdrop_path":"https://image.tmdb.org/t/p/original/6cgrh6dggt3Bv37PlmNi4FrlvE5.jpg","poster_path":"https://image.tmdb.org/t/p/original/nsj0RLRI10351uYMoAKPur6Derd.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"1090":{"id":"1090","name":"13º Andar","slug":"13-andar","original_title":"The Thirteenth Floor","overview":"Um homem acorda e descobre uma camisa ensanguentada em casa. Seu chefe foi assassinado na noite anterior, e ele não consegue se lembrar de nada. Esta ficção científica explora a possibilidade sinistra e assustadora de universos simulados por computadores, onde as pessoas apenas acreditam que são reais.","first_air_date":"1999-04-16","runtime":101,"episode_run_time":[101],"vote_average":7.1,"created_by":["Centropolis Film Productions","Columbia Pictures"],"production_companies":[{"name":"Centropolis Film Productions"},{"name":"Columbia Pictures"}],"cast":["Craig Bierko","Armin Mueller-Stahl","Gretchen Mol","Vincent D'Onofrio","Dennis Haysbert"],"backdrop_path":"https://image.tmdb.org/t/p/original/nJ0jz1J3zNja31UEMeklhgFeMw5.jpg","poster_path":"https://image.tmdb.org/t/p/original/2Wv6a0yNxTl7NH1f0FbPYC2kZvg.jpg","certification":"16","genres":["Thriller","Ficção científica","Mistério"],"trailer":"N/A"},
"1108354":{"id":"1108354","name":"Kali: Anjo Vingador","slug":"kali-anjo-vingador","original_title":"KALI: L'ange de la Vengeance","overview":"Um funcionário da alfândega francesa, Eric, que investiga um grande tráfico de medicamentos falsificados de uma fábrica no Brasil, é assassinado diante da Embaixada da França no Rio de Janeiro. Lisa, sua esposa, também ex-agente da alfândega, vai até lá para esclarecer o assassinato. Numa perseguição pela cidade e pela selva, a presa se transforma em caçadora.","first_air_date":"2024-05-31","runtime":0,"episode_run_time":[0],"vote_average":7.2,"created_by":["Daïgoro Films"],"production_companies":[{"name":"Daïgoro Films"}],"cast":["Sabrina Ouazani","Philippe Bas","Olivia Côte","Thiago Fragoso","Mathieu Lardot"],"backdrop_path":"https://image.tmdb.org/t/p/original/dVPPCD7wK0bFEB2NK3fw3CBidwd.jpg","poster_path":"https://image.tmdb.org/t/p/original/npYnwimjiKqWfg4Y9A1OoiBhmoU.jpg","certification":"N/A","genres":["Ação","Thriller","Aventura"],"trailer":"N/A"},
